import React, { useEffect, useState } from "react";

const Chatbot = () => {
  const [chatData, setChatData] = useState(null);

  useEffect(() => {
    fetch("/data/Chatbot.json")  // ✅ Ensure file is inside public/data
      .then((res) => res.json())
      .then((data) => setChatData(data))
      .catch((err) => console.error("Error loading chatbot JSON:", err));
  }, []);

  return (
    <div>
      <h2>Chatbot Loaded</h2>
      {chatData ? <pre>{JSON.stringify(chatData, null, 2)}</pre> : <p>Loading...</p>}
    </div>
  );
};

export default Chatbot;
